    <style>
        body {
            margin: 0;
            padding: 0;
            font-family: sans-serif;
        }

        .d-flex {
            display: flex;
        }
        
        .justify-center {
            justify-content: center;
        }

        .align-center {
            align-items: center;
        }

        .font-yellow {
            color: #D3AE36;
        }

        .font-pink {
            color: #BD6678;
        }

        section {
            position: relative;
            width: 100%;
            height: 60vh;
            display: flex;
            justify-content: center;
            overflow: hidden;
        }

        section::before {
            content: '';
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background-color: #2A2A2A;
            border-radius: 0 0 50% 50% / 0 0 100% 100%;
            transform: scaleX(1.2);
        }

        section .content {
            position: relative;
            z-index: 1;
            margin: 25px auto;
            text-align: center;
            font-size: 1.3em;
            font-weight: 400;
        }

        section .content h1 {
            font-size: 33px;
            color: white;
        }

        .mt-3 {
            margin-top: 10%;
        }

        section .content svg {
            width: 30px;
        }

        .px-3 {
            padding-left: 12px;
            padding-right: 12px;
        }

        .reasons {
            margin: 60px auto;
            font-size: 1em;
        }

        .reasons .dash {
            font-size: 20px;
        }

        .reasons .btn {
            background: white;
            padding: 12px 15px;
            margin-top: 10px;
            font-weight: 600;
            border: 2px solid #BD6678;
            border-radius: 7px;
            font-size: 1em;
        }

        .reasons .btn svg {
            width: 24px;
            margin-right: 3px;
        }

        @media (max-width: 768px) {
            section::before {
                transform: scaleX(1.3);
            }
            .d-flex {
            display: block;
            text-align: center;
            }
            section .content h1 {
                font-size: 28px;
            }
        }

    </style>
</head>
